#------------------------------------------------------------------------------#
#                                                                              #
# User Interface for the Shiny App for Pareto front plotting (Semochkina)      #
#                                                                              #
# Everything the user sees and inputs is controlled from here.                 #
#                                                                              #
#------------------------------------------------------------------------------#

shinyServer(function(input, output, session){
   source("www/functions/generate_plot.R")

   library(shiny)
   library(shinydashboard)

      output$ui_elements_1 <- renderUI({
         if (input$data_type1 == "MOEEQI") {
            # Generate UI elements for MOEEQI data_type1
            tagList(
               selectizeInput(inputId = 'beta_type1', label = 'Select beta level for MOEEQI algorithm', choices = c(.6, .7, .8, .9), selected = .6),
               selectizeInput(inputId = 'MC_type1', label = 'Select Monte Carlo sample size for MOEEQI', choices = c('single', 'mult'), selected = 'mult'),
               girafeOutput('xyplot1')
            )
         } else {
            # Generate UI elements for other plot types
            girafeOutput('xyplot1')
         }
      })

      output$ui_elements_2 <- renderUI({
         if (input$data_type2 == "MOEEQI") {
            # Generate UI elements for MOEEQI data_type2
            tagList(
               selectizeInput(inputId = 'beta_type2', label = 'Select beta level for MOEEQI algorithm', choices = c(.6, .7, .8, .9), selected = .9),
               selectizeInput(inputId = 'MC_type2', label = 'Select Monte Carlo sample size for MOEEQI', choices = c('single', 'mult'), selected = 'single'),
               girafeOutput('xyplot2')
            )
         } else {
            # Generate UI elements for other plot types
            girafeOutput('xyplot2')
         }
      })

   MOEEQI_1  <- reactive({
      req(input$MC_type1, input$beta_type1)
      MOEEQI_1_list <- list()
      for(k in 1:20){
         MOEEQI_1_list[[k]] <- read.csv(paste('www/data/MOEEQI_2024/scaled/results_2024_',input$MC_type1,'_noise_',input$noise_type1,'_beta_',input$beta_type1,'/result',k,'.csv', sep = ""), header=T)
      }
      MOEEQI_1 <- MOEEQI_1_list
   })
   qNEHVI_1  <- reactive({
      qNEHVI_1_list <- list()
      for(k in 1:20){
      qNEHVI_1_list[[k]] <- read.csv(paste('www/data/qNEHVI_2024/TrainingSet1_noise_',input$noise_type1,'_scale/repeat_',k,'.csv', sep = ""), header=T)
      }
      qNEHVI_1 <- qNEHVI_1_list
   })
   TSEMO_1  <- reactive({
      TSEMO_1_list <- list()
      for(k in 1:20){
      TSEMO_1_list[[k]]  <- read.csv(paste('www/data/TSEMO_2024/TrainingSet1_noise_',input$noise_type1,'_scale/repeat_',k,'.csv', sep = ""), header=T)
      }
      TSEMO_1 <- TSEMO_1_list
   })

   MOEEQI_2  <- reactive({
      req(input$MC_type2, input$beta_type2)
      MOEEQI_2_list <- list()
      for(k in 1:20){
         MOEEQI_2_list[[k]] <- read.csv(paste('www/data/MOEEQI_2024/scaled/results_2024_',input$MC_type2,'_noise_',input$noise_type2,'_beta_',input$beta_type2,'/result',k,'.csv', sep = ""), header=T)
      }
      MOEEQI_2 <- MOEEQI_2_list
   })
   qNEHVI_2  <- reactive({
      qNEHVI_2_lis <- list()
      for(k in 1:20){
         qNEHVI_2_lis[[k]] <- read.csv(paste('www/data/qNEHVI_2024/TrainingSet1_noise_',input$noise_type2,'_scale/repeat_',k,'.csv', sep = ""), header=T)
      }
      qNEHVI_2 <- qNEHVI_2_lis
   })
   TSEMO_2  <- reactive({
      TSEMO_2_list <- list()
      for(k in 1:20){
         TSEMO_2_list[[k]]  <- read.csv(paste('www/data/TSEMO_2024/TrainingSet1_noise_',input$noise_type2,'_scale/repeat_',k,'.csv', sep = ""), header=T)
      }
      TSEMO_2 <- TSEMO_2_list
   })

   dataset1 <- reactive({
      dataset1 <- get(paste(input$data_type1,'_1',sep=''))
   })
   dataset2 <- reactive({
      dataset2 <- get(paste(input$data_type2,'_2',sep=''))
   })


   # Generate plots for both panels
   output$xyplot1 <- renderGirafe({
      data1 <- dataset1()()
      generate_plot(data1, coeff, outputs, inputs, pareto_true)

   })
   output$xyplot2 <- renderGirafe({
      data2 <- dataset2()()
      generate_plot(data2, coeff, outputs, inputs, pareto_true)
   })
})

# This is a file which makes sure that all required packages are installed
# and loaded prior to starting the shiny application.

