    install.packages('devtools', dependencies = TRUE)
    require('devtools', character.only = TRUE)
  }

  if (!require('shinydashboard', character.only = TRUE)) {
    install.packages('shinydashboard', dependencies = TRUE)
    require('shinydashboard', character.only = TRUE)
  }

  if(!require('shiny', character.only = TRUE)){
    install.packages('shiny', dependencies = TRUE)
    require('shiny', character.only = TRUE)
  }

  if(!require('ggplot2', character.only = TRUE)){
    install.packages('ggplot2', dependencies = TRUE)
    require('ggplot2', character.only = TRUE)
  }

  if(!require('stringr', character.only = TRUE)){
    install.packages('stringr', dependencies = TRUE)
    require('stringr', character.only = TRUE)
  }

  if(!require('cowplot', character.only = TRUE)){
    install.packages('cowplot', dependencies = TRUE)
    require('cowplot', character.only = TRUE)
  }

  if(!require('scoringutils', character.only = TRUE)){
    install.packages('scoringutils', dependencies = TRUE)
    require('scoringutils', character.only = TRUE)
  }

  if(!require('dplyr', character.only = TRUE)){
    install.packages('dplyr', dependencies = TRUE)
    require('dplyr', character.only = TRUE)
  }

  if(!require('openxlsx', character.only = TRUE)){
    install.packages('openxlsx', dependencies = TRUE)
    require('openxlsx', character.only = TRUE)
  }
  if(!require('readxl', character.only = TRUE)){
    install.packages('readxl', dependencies = TRUE)
    require('readxl', character.only = TRUE)
  }
  if(!require('ggiraph', character.only = TRUE)){
    install.packages('ggiraph', dependencies = TRUE)
    require('ggiraph', character.only = TRUE)
  }
  if(!require('gtools', character.only = TRUE)){
    install.packages('gtools', dependencies = TRUE)
    require('gtools', character.only = TRUE)
  }
  if(!require('tidyverse', character.only = TRUE)){
    install.packages('tidyverse', dependencies = TRUE)
    require('tidyverse', character.only = TRUE)
  }
  if(!require('nleqslv', character.only = TRUE)){
    install.packages('nleqslv', dependencies = TRUE)
    require('nleqslv', character.only = TRUE)
  }
  if(!require('pso', character.only = TRUE)){
    install.packages('pso', dependencies = TRUE)
    require('pso', character.only = TRUE)
  }
}

ensure_packages()

pareto_front <- function(y1_obs, y2_obs, design){
  k=length(design[1,])
  Xtemp=design
  #find Pareto set
  b=order(y1_obs)
  PX <- Xtemp[b[1],1:k]
  Y1 <- y1_obs[b[1]]
  Y2 <- y2_obs[b[1]]
  Pnum=1
  for (i in 2:length(y1_obs)){
    if (y2_obs[b[i]]<=Y2[Pnum]){
      Pnum=Pnum+1
      PX <- rbind(PX, Xtemp[b[i],1:k])
      Y1 <- c(Y1,y1_obs[b[i]])
      Y2 <- c(Y2,y2_obs[b[i]])
    }
  }
  return(list(y1=Y1, y2=Y2, X=PX))
}
